reflector:
  reflect.submodules:
    dst:
      prefixPath: '{path::out.*=1}'
    mandatory: 1
    criterion:
      content: proto
    inherit:
      - 'submodule::*/exported::*=1/reflector::exported.files*=1'
  exported.proto.export:
    src:
      filePath:
        .: ''
      prefixPath: debug
    mandatory: 1
    criterion:
      default: 1
      debug: 1
      export: 1
      content: proto
  exported.files.proto.export:
    src:
      filePath:
        'path::exported.files.proto.export': ''
      basePath: .
      prefixPath: 'path::exported.dir.proto.export'
      recursive: 0
    recursive: 0
    mandatory: 1
    criterion:
      default: 1
      debug: 1
      export: 1
      content: proto
step:
  clean.out.:
    opts:
      filePath: 'path::out.*=1'
    criterion:
      debug: 0
    inherit:
      - files.delete
  clean.out.debug:
    opts:
      filePath: 'path::out.*=1'
    criterion:
      debug: 1
    inherit:
      - files.delete
  reflect.submodules:
    opts:
      reflector: 'reflector::reflect.submodules*'
    criterion:
      content: proto
    inherit:
      - files.reflect
  export.out.debug:
    opts:
      export: 'path::out.debug'
      tar: 0
    criterion:
      debug: 1
      content: proto
    inherit:
      - module.export
build:
  debug.raw:
    steps:
      - submodules.download
      - clean.out.*=1
      - reflect.submodules*=1
    criterion:
      default: 1
      debug: 1
      raw: 1
      content: proto
  proto.export:
    steps:
      - 'build::debug.raw'
      - 'step::export.out.debug'
    criterion:
      default: 1
      debug: 1
      export: 1
      content: proto
exported:
  proto.export:
    version: 0.1.0
    exportedReflector: 'reflector::exported.proto.export'
    exportedFilesReflector: 'reflector::exported.files.proto.export'
    exportedDirPath: 'path::exported.dir.proto.export'
    exportedFilesPath: 'path::exported.files.proto.export'
    criterion:
      default: 1
      debug: 1
      export: 1
      content: proto
